const favSeries = "amazon";
const FavS = () => {
    if(favSeries === 'netflix') {
        <Netflix />
    }
    else {
        return (
            <Card
                key = {sdata[3].id} 
                imgsrc={sdata[3].imgsrc}
                title={sdata[3].title}
                sname={sdata[3].sname}
                link={sdata[3].link} 
            />
        );
    }
}


const App = () => (
    <>
        <h1 className="heading_style">List of top 5 Netflix series in 2020</h1>
        {/* {sdata.map(ncard)} */}
        {/* {sdata.map((val) => {
            return (
                <Card
                    key = {val.id} 
                    imgsrc={val.imgsrc}
                    title={val.title}
                    sname={val.sname}
                    link={val.link} 
                />
            );
        })} */}
        <FavS />
    </>
);

export default App;
